import React from 'react';
import { Grid, Segment, Image, Icon, Divider } from 'semantic-ui-react'

const Footer = () => {

    return (
        <center>
            <Segment padded='very'>
                <Divider/>
                <div textAlign="center">
                    Activnts Pte Ltd | 2020
                </div>
            </Segment>
        </center>
    )
}

export default Footer;
